{
  "query": "query Judgements ($query: String, $first: Int, $last: Int, $before: String, $after: String, $sortColumnName: JudgementOrderField!, $sortDirection: OrderDirection!) {
  judgements(query: $query, first: $first, last: $last, before: $before, after: $after, orderBy:{field: $sortColumnName, direction: $sortDirection }) {
      edges {
        node {
            id
            type
            disposition
            reason
            reason_uri
            source
            source_uri
            severity
            confidence
            tlp
            priority
            valid_time {
              start_time
              end_time
            }
            observable {
              value
              type
            }
          }
          cursor
        }
        totalCount
        pageInfo {
          hasNextPage
          hasPreviousPage
          startCursor
          endCursor
        }
      }
    }",
  "variables": {
    "query": "observable.value:"$activity.definition_activity_021R3QFFWQAJ53YiqXPOtTIRkfKHZKsyti5.input.source_array[@].observable$"",
    "first": 100,
    "last": null,
    "after": null,
    "before": null,
    "sortColumnName": "VALID_TIME_START_TIME",
    "sortDirection": "desc"
  }
}
